(4, 'Shipping & Delivery Policy', 'Shipping & Delivery Policy', NULL, '<p><strong>UESI-TS STUDY CENTRE:</strong>&nbsp;<br><br>H.NO. 6-68/36, JANGAMPET (V) JINNARAM (M), SANGAREDDY (D) TELANGANA  502319 CELL: 7386598974</p>', '2022-03-09 00:48:36', '2022-03-09 01:59:09', NULL),
(6, 'About Us', 'About Us', NULL, '<div class=\"post-entry post-entry-type-page post-entry-19\"><div class=\"entry-content-wrapper clearfix\"><div class=\"flex_column av_one_full  flex_column_div first  nConfig-builder-el-0  nConfig-builder-el-no-sibling  \"><section class=\"av_textblock_section \" itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><div class=\"nConfig_textblock  \" itemprop=\"text\"><div>\n<p><strong>UESI</strong> is UESI is a Student Organization, run by the Students for the Students. UESI is a student ministry founded on Gods Word, born out of prayer, with a single-minded focus on presenting Christ to the students in India, discipling them, and enabling them to raise a testimony to the historic truths of the Christian faith..</p>\n<p><strong>Telangana</strong> State is formed by Indian Government on 2-Jun-2014. Subsequently UESI Telangana became a decentralized unit of UESI in 2015. UESI Telangana has its head office in Hyderabad and is working in all the districts of Telangana State.</p>\n</div>\n</div></section></div>\n</div></div>', '2023-02-21 08:25:10', '2023-02-21 08:25:10', NULL);
