eny You are crowned,\\nLord of all.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"B\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"18\",\n                \"title\": \"18. Bayeti bayeti Inkosi\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://app.uesits.com/audio_songs/english/songs/18.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"19\",\n        \"local_title\": \"Be on Guard oh my soul\",\n        \"local_hint\": \"Be on Guard oh my soul\",\n        \"local_text\": \"1. Be on Guard oh my soul,\\nThousand foes arise (2)\\nDrawing you from the path of\\nloving Christ\\nFighting constantly,\\nworking patiently\\nWatching every moment of the day\\nBe on guard,\\nHeeding every word and thought\\nEvery turning of the way.\\n\\n2. Be on guard oh my soul,\\nSins are pressing hard\\nCalling you from the path of holiness\\nlooking cautiously\\nwalking carefully\\nCleansing through\\nthe washing of the blood\\nWatch and pray\\nPressing hard in the holy way\\nprevailing over evil sway.\\n\\n3. Be on guard oh my soul,\\nSinful self surrounds\\nKeeping you a babe in Christ always\\nCrucified with Christ,\\nconsecrate your life\\nCasting all your cares upon the Lord\\nLean on God\\nCounting blessing manifold\\nManifested in the cross.\\n\\n4.Be on guard oh my soul,\\nFiends of air arrayed\\nFlaming arrows make your peace dismay\\nClaiming promises,\\npleading fervently,\\nStanding always,holy armour on.\\nFight with faith\\nTheres a crown of righteousness\\nCoronation on that day.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"B\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n   