ink\\nthat this could be...\\n\\n3. To see God,\\nThe God who talked with Moses.\\nTo see God,\\nWhose mercies are so endless\\nTo see God,\\nWhat better incentive\\nfor purity...\\n\\n4. To see God,\\nThe One I\'ve loved and longed for.\\nTo see God,\\nThe Father of my Saviour\\nTo see God,\\nA dream come true at last\\nHis face I\'ll see....\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"B\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"23\",\n                \"title\": \"23. Blessed are the pure in heart\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://app.uesits.com/audio_songs/english/songs/23.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"24\",\n        \"local_title\": \"Blessed be the Name of the Lord\",\n        \"local_hint\": \"Blessed be the Name of the Lord\",\n        \"local_text\": \"Blessed be the Name of the Lord,\\nMost High (2)\\nThe Name of the Lord is\\na Strong Tower\\nThe righteous run into it\\nand they are safe\\nHoly is the Name of the Lord...\\nGlory to the Name of the Lord...\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"B\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"24\",\n                \"title\": \"24. Blessed be the Name of the Lord\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://app.uesits.com/audio_songs/english/songs/24.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"25\",\n        \"local_title\": \"Blessed be the Name of the Lord\",\n        \"local_hint\": \"Blessed be the Name of the Lord\",\n        \"local_text\":