wer\\nBe unto the Ancient of Days\\nFrom every nation, all of creation,\\nBow before the Ancient of Days.\\nEvery tongue in heaven and earth,\\nShall declare Your glory,\\nEvery knee shall bow\\nAt Your throne in worship,\\nYou will be exalted O God,\\nAnd Your Kingdom shall not pass away,\\nO Ancient of Days!\\nYour Kingdom shall reign over all the earth\\nSing unto the Ancient of Days!\\nFor none can compare to Your\\nmatchless worth,\\nSing unto the Ancient of Days!\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"B\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"27\",\n                \"title\": \"27. Blessing and honour\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://app.uesits.com/audio_songs/english/songs/27.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"28\",\n        \"local_title\": \"Blessed Assurance\",\n        \"local_hint\": \"Blessed Assurance\",\n        \"local_text\": \"1. Blessed Assurance,\\nJesus is mine,\\nOh ! What a foretaste\\nof glory divine;\\nHeir of salvation, purchase of God\\nBorn of His Spirit,\\nwashed in His blood.\\nThis is my story, this ls my song\\nPraising my Saviour all the day long\\nThis is my story, this ls my song\\nPraising my Saviour all the day long.\\n\\n2. Perfect submission perfect delight\\nVisions of rapture\\nnow burst on my sight;\\nAngels descending\\nbring from above\\nEchoes of mercy, whispers of love.\\n\\n3. Perfect submission, all is at rest,\\nI, in my Saviour,\\nam happy and blest;\\nWatching and waiting,\\nlooking above,\\nFilled with His goodness.\\nlost in His love.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"B\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"28\",\n                \"title\": \"28. Blessed Assurance\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://app.uesits.com/audio_songs/english/songs/28.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"29\",\n        \"local_title\": \"Breathe on me, Breathe of God\",\n        \"local_hint\": \"Breathe on me, Breathe of God\",\n        \"local_text\": \"1. Breathe on me, Breathe of God\\nFill me with life anew\\nThat I may love\\nwhat Thou dost love\\nAnd do what Thou wouldst do\\n\\n2. Breathe on me, Breath of God\\nUntil my heart is pure\\nUntil my will is one with Thine\\nTo do and to endure.\\n\\n3. Breathe on me, Breath of God\\nTill I am wholly Thine\\nUntil this earthly part of me\\nGlows with Thy fire divine\\n\\n4. Breathe on me, Breath of God\\nSo shall I never die\\nBut Live with Thee the perfect Life\\nOf Thine eternity.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"B\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"29\",\n                \"title\": \"29. Breathe on me, Breathe of God\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://app.uesits.com/audio_songs/english/songs/29.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"30\",\n        \"local_title\": \"Bring a Psalm to the Lord\",\n        \"local_hint\": \"Bring a Psalm to the Lord\",\n        \"local_text\": \"Bring a Psalm to the Lord\\nFrom the Spirit and from His word,\\nLift your voice and rejoice\\nFor our God is a mighty King,\\nso come and clap your hands,\\nRaise a shout\\nAs we stand before the Lord,\\nFor the Lord is He\\nwho has the power to free,\\nWho by his mighty arm\\n