",\n        \"local_text\": \"1. God sent his Son,\\nThey called him Jesus;\\nHe came to love, heal, and forgive;\\nHe lived and died\\nto buy my pardon,\\nAn empty grave is there to prove\\nmy Saviour lives.\\n\\nCHORUS:\\nBecause He lives\\nI can face tomorrow;\\nBecause He lives all fear Is gone;\\nBecause I know He holds the future\\nAnd life is worth the living just\\nbecause He lives.\\n\\n2. How sweet to hold a new-bom baby,\\nAnd feel the pride, and joy he gives;\\nBut greater still the calm assurance,\\nThis child can face uncertain days\\nbecause He lives.\\n\\n3. And then one day I\'ll cross the river;\\nI\'ll fight life\'s final war with pain\\nAnd then as death\\ngives way to victory\\nI\'ll see the lights of glory and\\nI\'ll know He lives.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"G\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"70\",\n        \"local_title\": \"God will make a way\",\n        \"local_hint\": \"God will make a way\",\n        \"local_text\": \"God will make a way,\\nWhere there seems to be no way.\\nHe works in ways we cannot see,\\nHe will make a way for me.\\nHe will be my Guide,\\nHold me closely to His side,\\nWith love and strength for each new day.\\nHe will make a way.\\nHe will make a way.\\nBy a roadway in the wilderness,\\nHe\'ll lead me\\nAnd rivers in the desert will I see\\nHeaven and earth will fade\\nBut His Word will still remain\\nHe will do something new today.\\nGod will make a way,\\nWhere there seems to be no way.\\nHe works in ways we cannot see,\\nHe will make a way for me.\\nHe will be my Guide,\\nHold me closely to His side,\\nWith 