nged our tears of sadness\\ninto rivers of joy\\nJesus turned our sorrow into a dance.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"J\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"143\",\n        \"local_title\": \"Jesus, Name above all Names\",\n        \"local_hint\": \"Jesus, Name above all Names\",\n        \"local_text\": \"Jesus, Name above all Names\\nBeautiful Saviour, Glorious Lord;\\nEmmanuel, God is with us;\\nBlessed Redeemer, Living Word.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"J\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"144\",\n        \"local_title\": \"Joy to the world\",\n        \"local_hint\": \"Joy to the world\",\n        \"local_text\": \"1. Joy to the world,\\nthe Lord is come to Thee,\\nLet earth receive her King.\\nLet every heart prepare Him room\\nAnd heav\'n and nature sing.\\nAnd Heav\'n and nature sing,\\nAnd Heav\'n and heav\'n and nature sing\\n\\n2.Joy to the world, the Saviour reigns,\\nLet men their songs employ;\\nWhile fields and floods,\\nRocks hills and plains\\nRepeat the sounding joy,\\nRepeat the sounding joy,Repeat,Repeat the sounding joy\\n\\n3. No more let sin and sorrows grow,\\nNor thorns infest the ground;\\nHe comes to make His blessings flow\\nFar as the curse is found,\\nFar as the curse is found,\\nFar as, far as the curse is found.\\n\\n4. Herules the world with truth and grace,\\nAnd makes the nations prove\\nThe glories of His righteousness.\\nAnd wonders of His love,\\nAnd wonders of His love,\\nAnd wonder,wonders of His love.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"J\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"144\",\n                \"title\": \"144. Joy to the world\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://app.uesits.com/audio_songs/english/songs/144.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"145\",\n        \"local_title\": \"Just as I am\",\n        \"local_hint\": \"Just as I am\",\n        \"local_text\": \"1. Just as I am, without one plea\\nBut that Thy blood was shed for me,\\nAnd that Thou blood bid\'st me come to Thee,\\nO Lamb of God,I come I come\\n\\n2.Just as I am, and waiting not\\nTo rid my soul of one dak blot,\\nTo Thee, whose blood can\\ncleanse each spot,\\nO Lamb of God, I come.\\n\\n3. Just as I am, though tossed about\\nWith many a conflict, many a doubt,\\nFightings and fears within, without,\\nO Lamb of God, I come.\\n\\n4. Just as I am, poor, wretched, blind:\\nWith many a conflict, many a doubt,\\nFightings and fears within, without,\\nO Lamb of God, I come.\\n\\n5. Just as Iam, poor, wretched, blind:\\nSight, riches, healing of the mind,\\nYea, all I need in Thee to find\\nO Lamb of God, I come.\\n\\n6. Just as Iam, Thou wilt receive,\\nWilt welcome, pardon, cleanse, relieve,\\nBecause Thy promise I believe,\\nO Lamb of God, I come.\\n\\n7. Just as I am, Thy love unknown\\nHas broken every barrier down;\\nNow to be Thine, yea, Thine alone,\\nO Lamb of God, I come.\\n\\n8. Just as I am, of that free love\\nThe breadth, length, depth\\nand height to prove.\\nHere for a season, then above,\\nO Lamb of God, I come.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"J\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"146\",\n        \"local_title\": \"Know Ye not, know ye not\",\n        \"local_hint\": \"Know Ye not, know ye not\",\n        \"local_text\": \"Know Ye not, know ye not,\\nYou are the temple?\\nKnow ye not, know ye not,\\nYou are the temple?\\nKnow ye not, know ye not,\\nYou are the temple?\\nYou are the temple of the Holy Ghost.\\nFilled with grace,\\nFilled with power,\\nfilled with glory...\\nYes, I know,\\nYes, I know,\\nI am the temple...\\nClap your hands,\\nClap your hands,\\nAll ye people...\\nHallelu, Hallelu,\\nAll ye people...\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"K\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"147\",\n        \"local_title\": \"Lead me to some soul today\",\n        \"local_hint\": \"Lead me to some soul today\",\n        \"local_text\": \"Lead me to some soul today;\\nO teach me, Lord, just what to say\\nFriends of mine are lost in sin,\\nAnd cannot find their way.\\nFew there are who seem to care,\\nAnd few there are who pray;\\nMelt my heart and il my life,\\nGive me one soul tod