ignty man of God was he\",\n        \"local_text\": \"Mignty man of God was he-\\nElijah Elijah Elijah\\nA man of faith and simplicity\\nElijah Elijah Elijah\\nCame out of nowhere from a desert land\\nGod had a message for this chosen man\\nIf the Lord is God\\nthen serve Him now, said Elijah\\nMighty man of God was he-\\nDaniel Daniel Daniel\\nA man of strict in-te-grity, he was\\nDaniel Daniel Daniel\\nWhile the others couldn\'t make him sway\\nIn the peace of just enough to pray\\nAnd the angel saved his life\\nAnd they worshipped God,\\nbecause of Daniel.\\nO is there a man\\nLiving in the world today\\nNot caught up in riches\\nNot caught up as slave\\nO is there a man\\nLiving in the world today\\nWho wants to give his life\\nTo serve the Lord\\nMighty man of God was he-\\nPaul Paul Paul\\nA man with zeal and simplicity\\nPaul Paul Paul\\nOne truth was all he had\\nand now He saw\\nRighteousness by faith alone\\nand not by the Law\\nAnd the Gentiles heard him too\\nBut they didn\'t doubt the message.\\nThat\'s from Paul\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"180\",\n        \"local_title\": \"More love, more power\",\n        \"local_hint\": \"More love, more power\",\n        \"local_text\": \"More love, more power,\\nMore of You in my life (2)\\n\\n1. And I will worship You\\nWith all of my heart,\\nAnd I will worship You\\nWith all of my ming,\\nAnd I will worship You\\nWith all of my strength,\\nFor You are my Lord,\\n\\n2. And I will seek Your face\\nWith all of my heart/mind/strength\",\n        \"local_category\": \"nothing\