 You.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"183\",\n        \"local_title\": \"My Lord, what love is this\",\n        \"local_hint\": \"My Lord, what love is this\",\n        \"local_text\": \"My Lord, what love is this,\\nThat pays so dearly\\nThat I the guilty one,May go free.Amazing love, O what sacrifice,\\nThe Son of God givin for me,\\nMy debt He pays, and my death He dies,\\nThat I might live, that I might live.\\nAnd so they watched Him die,Despised, rejected;\\nBut oh, the blood he shed,Flowed for me.\\nAnd now this love of Christ,\\nShall flow like rivers;\\nCome wash your guilt away,Live again.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"184\",\n        \"local_title\": \"My Saviour, Redeemer\",\n        \"local_hint\": \"My Saviour, Redeemer\",\n        \"local_text\": \"My Saviour, Redeemer,\\nLifted me from the miry clay,\\nAlmighty, Forever,\\nI will never be the same,\\n\\nPre chorus:\\nCause You came near,\\nFrom the everlasting,\\nTo the world we live,\\nThe Fathers only Son\\n\\nCHORUS:\\nYou lived,and You died\\nYou rose again on high\\nYou\'ve opened the way,\\nFor the world to live again,\\nHallelujah,For all Youve done\\n\\nBRIDGE:\\nHallelujah,For all Youve done\\nHallelujah For all Youve Done(keep repeating)\\nEnding:\\nHallelujah,For all Youve done\\n(keep repeating)\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"185\",\n        \"local_title\": \"O my soul\",\n        \"local_hint\": \"O my soul\",\n        \"local_text\": \"O my soul\\nDo you not know,\\nHave you not heard\\nIts been ol from the beginning\\nThat the Lord Your God is on your side\\nO my soul, don\'t be afraid\\nHope in ine Lord\\nBy His righteousness and power\\nHe will strengthen, He will guide\\nAnd I will soar on wings like eagles\\nHeld by the hand of God\\nI will run and not grow tired\\nWhen on His name I call\\nFor the Lord is never weary\\nHis ways are beyond my thoughts\\nI will trust in Him, with all my heart.\\nAnd I will rest upon His promise.\\nPatiently I\'ll wait.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"O\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"186\",\n        \"local_title\": \"O come, all ye faithful\",\n        \"local_hint\": \"O come, all ye faithful\",\n        \"local_text\": \"1. O come, all ye faithful\\nJoyful and triumphant,\\nO come ye, O come ye to Bethlehem;\\nCome and behold Him,\\nBorn the King of angels:\\n\\nCHORUS:\\nO come, let us adore Him\\nO core, let us adore Him,\\nO Come, let us adore Him,\\nChrist the Lord.\\n\\n2. God of God, Light of Light,\\nLo! he abhors not the Virgin\'s womb;\\nVery God, Begotten not created\\n\\n3. Sing, Choirs of Angels\\nSing in exultation,\\nSing all ye citizens of heaven above,\\nGlory to God In the highest;\\n\\n4. Yea, Lord, we greet Thee,\\nBorn this happy morning\\nJesus, to Thee be glory given;\\nWord of the Father,\\nNow in flesh appearing.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"O\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"187\",\n        \"local_title\": \"Oh Lord my God\",\n        \"local_hint\": \"Oh Lord my God\",\n        \"local_text\": \"1. Oh Lord my God !\\nWhen I, in awesome wonder,\\nConsider all the works\\nThy hand hath made,\\nI see the stars,\\nI hear the mighty thunder,\\nThy power throughout\\nThe Universe Displayed.\\n\\nCHORUS:\\nThen sings my soul,\\nMy Saviour God to Thee,\\nHow great Thou art !\\nHow great Thou art !\\nThen sings my soul,\\nMy Saviour God to Thee,\\nHow great Thou art !\\nHow great Thou art !\\n\\n2. When through the woods\\nAnd forest glades I wander\\nAnd hear the birds\\nSing sweetly in the trees\\nWhen I look down\\nFrom lofty mountain grandeur\\nAnd hear the brook\\nAnd feel the gentle breeze\\n\\n3. And when I think,\\nThat God, His Son not sparing\\nSent Him to die,\\nI scarce can take it in;\\nThat on the cross,\\nMy burden gladly bearing,\\nHe bled and died\\nTo take away my sin;\\n\\n4. When Christ shall come\\nWith shout of a