\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"216\",\n        \"local_title\": \"Standing on the promises\",\n        \"local_hint\": \"Standing on the promises\",\n        \"local_text\": \"Standing on the promises of\\nChrist the Lord.\\nThrough eternal ages\\nlet His praises ring\\nGlory in the highest\\nI will shout and sing\\nStanding on the promises of God.\\n\\nCHORUS:\\nStanding, Standing\\nStanding on the promises\\nof God my Saviour\\nStanding, Standing\\nI\'m standing on the Promises of God.\\n\\n2.Standing on the promises that cannot fail\\nWhen the howling storms of\\ndoubt and fear assail;\\nBy the living Word of God\\nI shall prevail,\\nStanding on the promises of God\\n\\n3.Standing on the promises I now can see\\nI now can see\\nPerfect,Present cleansing\\nin the blood for me\\nStanding in the liberty where Christ makes free.\\nStanding on the promises of God.\\n\\n4.Standing on the promises of Christ the Lord\\nBound to Him eternally\\nby love\'s strong cord.\\nOvercoming daily\\nwith the Spirit\'s sword.\\nStanding on the promises of God.\\n\\n5.Standing on the promises I cannot fail\\nListening every moment to the Spirit\'s call\\nResting in my Saviour\\nas my All-in-all,\\nStanding on the promises of God\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"S\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"217\",\n        \"local_title\": \"Such love\",\n        \"local_hint\": \"Such love\",\n        \"local_text\": \"Such love pure as the whitest snow\\nsuch love Weeps for the shame I know;\\nSuch love paying the debt I owe;\\nO Jesus such love.\\n\\n2.Such love,stilling my restlessness\\nSuch love filling my emptiness\\nSuch love,showing me holiness;\\nO Jesus,such love\\n\\n3.Such love,springs from eternity; such love\\nStreaming through history\\nSuch love fountain of the to me;\\nO Jesus,such love\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"S\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"218\",\n        \"local_title\": \"Sweet hour of prayer\",\n        \"local_hint\": \"Sweet hour of prayer\",\n        \"local_text\": \"1. Sweet hour of prayer\\nSweet hour of prayer !\\nThat calls me from a world of care,\\nAnd bids me at my Father\'s throne\\nMake all my wants and wishes known;\\nIn seasons of distress and grief,\\nMy soul has often found relief,\\nAnd oft escaped the tempter\'s snare,\\nBy Thy return.\\nSweet hour of prayer. (2)\\n\\n2. Sweet hour of prayer,\\nSweet hour of prayer !\\nThe wings shall my petition bear,\\nTo Him whose truth and faithfulness\\nEngage the waiting soul to bless\\nAnd since he bids me seek His face\\nBelieve His word and trust His grace,\\nI\'ll cast on Him my every care,\\nAnd wait for thee, sweet hour of prayer.\\nSweet hour of prayer. (2)\\n\\n3. Sweet hour of prayer,\\nSweet hour of prayer !\\nMay I Thy consolation share,\\nTill, from Mount Pisgah\'s lofty height\\nI view my home, and take my flight\\nThis robe of flesh I\'ll drop and rise\\nTo sieze the everlasing prize;\\nAnd shout, while passing\\nthrough the air\\nFarewell, farewell,\\nSweet hour of prayer ! (2)\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_lette