        \"local_title\": \"Deep jale Prabhu naam rahe\",\n        \"local_hint\": \"Deep jale Prabhu naam rahe\",\n        \"local_text\": \"Deep jale Prabhu naam rahe \\nMere mandir mein mandir mein \\n\\n1. Sanjsavera, yeh man gayeh \\nYeshu thera naam, prabhu Yeshu Tera naam \\nNaam rahe man mein Prabhu \\nNaam rahe man mein (2)  ||Deep|| \\n\\n2. Deep jalaye, raha niharun \\nDarshan ko, prabhu darshan ko \\nAan baso dil mein, prabhu aan \\nBaso dil mein  ||Deep||\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"9\",\n        \"local_title\": \"Dharthi aakash dono\",\n        \"local_hint\": \"Dharthi aakash dono\",\n        \"local_text\": \"Dharthi aakash dono \\nPrabhu ki aavaz sunenge \\nSansaar ke sab praani,\\nUska hi naar lenge \\nDharthi aakash dono \\n\\n1. Pabhu ka vachan aisa hai,\\nJo chiraag sa jalta hai \\nUs par koi chalta hai,\\nJeevan use milta hai \\nUske niyam ko jo mane,\\nWoh kabhibhi na bhatkenge \\nsansaar ke sab praani \\n\\n2. Pabhu ka samay aata hai,\\nDharthi magan hoagi,\\nUski daya barsegi,\\nAur door jalan hoagi,\\nUske vachan ki mahima \\nAur shakthi ham dekhenge sansaar ke sab praani \\n\\n3. Ankhe uthakar dekho,\\nPrabhu ka din aayega \\nUsko grahan jo karega, \\nwahi saath jaayega \\nJisne prabhu ko na maana,\\nWoh ek din royega \\nsansaar ke sab praani\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"